import React from 'react';
import { View, StyleSheet, Text } from 'react-native';

export default function Sandbox() {
    return(
        <View style={StyleSheet.container}>
            <Text style={styles.box1}>Positif</Text>
            <Text style={styles.box2}>Sembux</Text>
            <Text style={styles.box3}>Meninggal</Text>
        </View>
    )
}
  

const styles = StyleSheet.create({
    container: {
        flex:1,
        flexDirection: 'row',
        paddingTop: 40,

    },
    box1: {
        backgroundColor: 'yellow',
        marginBottom:0,
        marginLeft: '5%',
        width: '20%',
        shadowColor: '#000',
        shadowOpacity:0.2,
        shadowRadius:1,
        shadowOffset:{
            width:3,
            height:3
        }
    },
    box2: {
        backgroundColor: 'blue',
        padding: 10,
    },
    box3: {
        backgroundColor: 'red',
        padding: 10,
    },
})
